function Table() {
  const dataStore = useSelector((state) => state.monthsData)
  console.log(dataStore, "ffff")
  const config = [
    {
      label: 'Months',
      render: (data) => data.monthName,
    },
    {
      label: 'Work',
      render: (data) => data.spheres.work,
    },
  ];
  return(
    <table>
    <thead>
      <tr>
        {config.map((headerData)=> {
          return <th  key = {headerData.id} >{headerData.label}</th>
        })}
      </tr>
    </thead>
    <tbody>
       {
        dataStore.map((month) => 
